demo.repl.help:
Dostępne polecenia:
  @show              ─ wyświetl podsumowanie ostatniej karty adaptacyjnej
  @json              ─ wypisz surową wartość JSON otrzymaną z przepływu
  @back              ─ przywróć poprzednią zablokowaną kartę/wejścia
  @input <k>=<v>     ─ ustaw lub nadpisz pole wejściowe
  @click <action_id> ─ prześlij kartę z podaną akcją
  @help              ─ wyświetl ten tekst pomocy
  @quit              ─ zakończ REPL
